    number: '6'
    value: This memo is a brief outline of the best efforts program for the Washington
      State Republican Party.  Every week the committee selected a file of donors
      (aggregates 200+) missing the required employer/occupation information for the
      given week. These donors were placed in a unique file and were mailed a best
      efforts letter response letter. The committee mailed these letters weekly. All
      best efforts letters included a postage-paid return envelope with an enclosed
      personalized letter with the  donors name, address, member number and the FEC
      disclosure information. The letter also gave the donor the option of providing
      his or her missing information by phone, fax or e-mail. The committee  also
      used any available contact info (email address, phone numbers) provided by the
      contributor to obtain all required info. Letters returned to the Post Office
      Box were entered into the system by a member of the database team. No employee
      whose payroll appears on schedule H4 spent more than 25% of their time on FEA.
  - value: '

'
